import { useEffect } from "react"
import { useState } from "react"
function Home(){
    const [data, setData] = useState([])
    // cosnt[Value, setValue] = useState()
    // const [sort, setSort] = useState()

    useEffect(() => {
        fetch("http://localhost:3008/Products")
            .then((res) => {
                return res.json()
            })
            .then((resp) => {
                setData(resp)
            })
    }, [])

return (
        <div>    
            <nav class="navbar navbar-expand-lg bg-body-tertiary">
                <div class="container-fluid">
                    <a class="navbar-brand" href="#"><img src="https://www.zarla.com/images/zarla-our-kitchen-1x1-2400x2400-20210607-g7q69ybhqxvvy7rtwvvj.png?crop=1:1,smart&width=250&dpr=2" alt="..." width="100px" height="80px"/></a>
                    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span class="navbar-toggler-icon"></span>
                    </button>
                    <div class="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                        <form class="d-flex col-6 w-auto" role="search">
                            <input class="form-control me-2" type="search" placeholder="Search"/>
                            <button class="btn btn-outline-success" type="submit">Search</button>
                        </form>
                            <li class="nav-item">
                                <a class="nav-link fs-5 ml-5" href="#"><i class="bi bi-cart-plus-fill"></i></a>
                            </li>
                            <li class="nav-item dropdown">
                                <a class="nav-link dropdown-toggle" href="#" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                                    Dropdown
                                </a>
                                <ul class="dropdown-menu">
                                    <li><a class="dropdown-item" href="#">Action</a></li>
                                    <li><a class="dropdown-item" href="#">Another action</a></li>
                                    <li><hr class="dropdown-divider"/></li>
                                    <li><a class="dropdown-item" href="#">Something else here</a></li>
                                </ul>
                            </li>
                        </ul>
                        
                    </div>
                </div>
            </nav>
        </div>
        )}      
        
    

export default Home;
